import React from "react";
import Toggle from "../Toggle/Toggle.js"


const Navbar = () => {
    return(
            <div className="n-wrraper" id="Navbar">
                {/* left */}
                <div className="n-left">
                    <div className="n-name">United Web Team</div>
                    <Toggle />
                </div>
                <div className="n-right">
                    <div className="n-"></div>
                </div>
                

            </div>
    )
}


export default Navbar
